import { useNavigate } from "react-router-dom";
import React from 'react';
import {
    StyleSheet,
    Text,
    TextInput,
    SafeAreaView,
    Pressable,
  } from 'react-native';

const Login = () => {
  const Navigate =useNavigate()
    return (
        <SafeAreaView style={styles.container}>
          <TextInput placeholder="Email" style={styles.inputStyle} />
          <TextInput
            secureTextEntry={true}
            placeholder="Password"
            style={styles.inputStyle}
          />
          <Pressable onPress={() => Navigate('/User_id')} style={styles.button}>
            <Text style={styles.buttonLabel}>Login</Text>
          </Pressable>
        </SafeAreaView>
    );
}

const styles = StyleSheet.create({
    container: {
      flex: 1,
      alignItems: 'center',
      justifyContent: 'center',
    },
    formLabel: {
      fontSize: 20,
      color: '#fff',
    },
    inputStyle: {
      marginTop: 20,
      width: 300,
      height: 40,
      paddingHorizontal: 10,
      borderRadius: 50,
      backgroundColor: '#DCDCDC',
    },
    formText: {
      alignItems: 'center',
      justifyContent: 'center',
      color: '#fff',
      fontSize: 20,
    },
    text: {
      color: '#fff',
      fontSize: 20,
    },
    button: {
      marginTop: 20,
      paddingHorizontal: 10,
      // paddingVertical: 6,
      borderRadius: 50,
      // backgroundColor: 'oldlace',
      // marginHorizontal: '1%',
      // marginBottom: 6,
      // minWidth: '48%',
      width: 300,
      height: 40,
      // textAlign: 'center',
      alignItems: 'center',
    },
    buttonLabel: {
      fontSize: 20,
      fontWeight: 'bold',
      color: 'blue',
    },
});

export default Login;
